  return (
    <div>
      <h1>Hello World</h1>
      <Potato />
    </div>

    // Potato.js에 Potato 컴포넌트를 만든다 (JSX)
    // App 컴포넌트의 반환 값으로 Potato 컴포넌트를 추가
